import React, { useState } from "react";
import MyButton from "./MyButton";

const DiaryList = ({ diaryList }) => {
    return (
        <div>
            <MyButton />
            {diaryList.map((it) => {
                return <div key={it.id}>{it.content}</div>;
            })}
        </div>
    );
};

export default DiaryList;
